import { Container, UL } from "../ContainerZ"
import { Info } from "../References/style"
import { Li } from './style'

export function Legend({info:legend, atr: atr_n, ref}){

  if(atr_n != null){
    return (
      <Container side={'right'} w={'25vw'} h={'29vw'}> 

          <h3 >{atr_n}</h3>
          <UL>
            <ul>
              {legend?.map(repo =>{
                return(
                  <Li color={repo.color} key={repo.atr}>
                   <button className="btn"> {repo.atr} </button>
                  </Li>
                )
              })}
            </ul>
            </UL>
            <Info>
                <div>
                    <h4> PROJETO GEOESTE - UTFPR </h4>
                    <h4> SRC: {ref?.src}</h4>
                    <h4> FONTES: {ref?.fontes} </h4>
                    <h4> ELABORAÇÃO: {ref?.elaboracao} </h4>
                </div>
            </Info>
        </Container>
    )
  }else{
    return(
      <div></div>
    )
  }
}
